            BinaryPrimitives.WriteUInt32BigEndian(buffer[salt.Length..], (uint)i);
            hash.Append(buffer[salt.Length..]);
            BinaryPrimitives.WriteUInt32BigEndian(buffer[salt.Length..], hash.GetCurrentHashAsUInt32());
            var md5 = BinaryPrimitives.ReadUInt128LittleEndian(MD5.HashData(buffer));
            keys[i] = baseKeys[i] ^ md5;
